import Numeric.LinearAlgebra

normalize :: (Fractional a) => [a] -> a -> a -> [a]
normalize arr minval maxval = map (func) arr
    where 
        func x = (x - minval) / (maxval - minval)

--Take an array and do a 70/30 split for a training and test split
train_test_split :: (Num a) => [a] -> ([a], [a])
train_test_split xs = ( take train xs , reverse (take test ( reverse xs )))
    where train = floor ( realToFrac (length xs ) * 0.7)
          test = length xs - train
            
-- -- --using batch gradient descent to minimize function (in this case mean squared error) for a linear function (mx + b)
-- gradient_descent ::  (Fractional a, Ord a) =>  [[a]] -> [a] -> [a] -> a-> a -> a-> (a,a)
-- gradient_descent x_batch y_batch weights offset old_mse iters

--     | iters > 100000 = (m,b)
--     | otherwise = do
         let train_pred_mx= map sum (toLists ( tr ( x * weights) ))
         let train_pred = map (+offset) train_pred_mx
         let train_err =  (sumElements (y - (fromLists [train_pred])) ^2 ) / realToFrac  (length train_pred)
        
--         if abs (train_err - old_mse) < 0.00001 && abs (old_mse)  > 0
--             then gradient_descent x_batch y_batch m b train_err 100001
--             else
--                 do
                     let gradient_offset = - ( 2 / realToFrac (cols y ) ) * sumElements(y - (fromLists [train_pred]))
                     let gradient_weights = map ( * ( - ( 2 / realToFrac (cols y ) )))  (map sum ( toLists (x   * (y - (fromLists [train_pred])))))
                    
                         let new_offset = offset - lr * gradient_offset
                         let intermediate_weights = (cols weights >< rows weights) (take (rows weights * cols weights) (cycle gradient_weights))
                         let new_weights = weights - (lr * (tr intermediate_weights))
-- --                     gradient_descent x_batch y_batch new_m new_b train_err (iters + 1)

--     where 
--         batch_size = realToFrac ( length y_batch )
--         lr = 0.1

